//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.12;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract DAMP is ReentrancyGuard{
    event TradeStatusChange(uint256 ad,bytes32 status);

    address payable immutable FeeAddress;
    uint immutable FeePercent;
    uint256 itemCounter;
    IERC721 itemToken;
    IERC20 currencyToken;


    struct Item{
        uint itemId;
        address payable seller;
        IERC721 NFT;
        uint256 tokenId;
        uint256 price;
        bytes32 status; // LISTED, SOLD, CANCELLED
    }

    enum Status{LISTED, SOLD, CANCELLED}
    mapping(uint => Item) public items;

    constructor(uint256 _FeePrecent, address payable _itemTokenAddress,address _currencyTokenAddress)payable  {
        FeeAddress = payable(msg.sender);
        FeePercent = _FeePrecent;
        currencyToken = IERC20(_currencyTokenAddress);
        itemToken = IERC721(_itemTokenAddress);
        itemCounter = 0;
    }


    function listNft(uint256 _tokenId, uint256 _price)public{
        require(_price > 0, "Price must greater than 0");
        itemToken.transferFrom(msg.sender, address(this), _tokenId);
        items[itemCounter] = Item({itemId: itemCounter,seller: payable(msg.sender),NFT: itemToken,tokenId: _tokenId,price: _price,status: "OPEN"});
        itemCounter += 1;
        emit TradeStatusChange(itemCounter - 1, "Open");


    }

    function executeNft(uint _tokenId) external payable {
        Item memory item = items[_tokenId];
        require(item.status == "Open", "Item is not open for trade");
        currencyToken.transferFrom(msg.sender, item.seller, item.price);
        itemToken.transferFrom(address(this), msg.sender, item.tokenId);
        items[_tokenId].status = "Excuted";
    }


    function cancelTrade(uint _tokenId) public {
        Item memory item = items[_tokenId];
        require( msg.sender == item.seller,"Trade can be cancelled only by poster.");

        require(item.status == "Open", "Trade is not Open.");
        itemToken.transferFrom(address(this), item.seller, item.tokenId);
        items[_tokenId].status = "Cancelled";
        emit TradeStatusChange(_tokenId, "Cancelled");
        }



}

